import React from "react";
import "./Nav.css";
import Logo from "../Images/Logo-hois.svg"
import styled from "styled-components";

const Nav = () => {
  return (
      <NavBar>
      <img src={Logo} alt="Mainlogo" />
      </NavBar>
  )
};

const NavBar = styled.nav``;

export default Nav;
